import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { FiHome, FiUser, FiCamera, FiFilm, FiMail, FiMenu, FiX } from 'react-icons/fi';
// import { FaB } from 'react-icons/fa';

const Navbar = () => {
  const [collapsed, setCollapsed] = useState(false);

  const toggleNavbar = () => {
    setCollapsed(!collapsed);
  };

  return (
    <>
      <nav className={`vertical-navbar ${collapsed ? 'collapsed' : ''}`}>
        <div className="nav-logo">
          <span className="logo-full">Bluepolaroid</span>
        </div>

        <ul className="nav-links">
          <li>
            <Link to="/">
              <span className="nav-icon"><FiHome /></span>
              <span>Home</span>
            </Link>
          </li>
          <li>
            <Link to="/about">
              <span className="nav-icon"><FiUser /></span>
              <span>About</span>
            </Link>
          </li>
          <li>
            <Link to="/gallery">
              <span className="nav-icon"><FiCamera /></span>
              <span>Gallery</span>
            </Link>
          </li>
          <li>
            <Link to="/projects">
              <span className="nav-icon"><FiFilm /></span>
              <span>Projects</span>
            </Link>
          </li>
          <li>
            <Link to="/contact">
              <span className="nav-icon"><FiMail /></span>
              <span>Contact</span>
            </Link>
          </li>
        </ul>

        <div className="nav-footer">
          Â© {new Date().getFullYear()} Bluepolaroid
        </div>
      </nav>

      <button className="nav-toggle" onClick={toggleNavbar}>
        {collapsed ? <FiMenu /> : <FiX />}
      </button>
    </>
  );
};

export default Navbar;
